import React, { useState, useEffect } from 'react';

import { Grid, InputLabel, Select, MenuItem } from '@material-ui/core';
import { StylesProvider } from '@material-ui/styles';

import axios from 'axios';

import styles from './App.module.scss';

const App = () => {
  const [totalEarn, setTotalEarn] = useState(0);
  const [averageRevenue, setAverageRevenue] = useState(0);
  const [uniqueCustomersCount, setUniqueCustomersCount] = useState(0);

  useEffect(() => {
    axios.get('http://localhost:3000/').then((response) => {
      /*
      totalEarn: "16600131.62"
averagePrice: "748.09"
customerAmount: 4372

      */
      if (response.status === 200) {
        console.log(response)
        //setTotalEarn(response.body);
      }
    });
  }, []);

  return (
    <Grid className={styles.App} container>
      <StylesProvider injectFirst>
      <Grid item container direction='row' alignItems='center' spacing={2}>
        <Grid item>
          <InputLabel>Country</InputLabel>
        </Grid>
        <Grid item>
          <Select id="select" value="France">
            <MenuItem value="France">France</MenuItem>
            <MenuItem value="Italia">Italia</MenuItem>
          </Select>
        </Grid>
      </Grid>
      <Grid item container>
        <h1>Summary</h1>
        <Grid item container direction='row'>
          <Grid item xs={4}>
            <div className={styles.detailsMain}>
              <div className={styles.detailsLabel}>Revenue</div>
              <div className={styles.detailsValue}>{totalEarn}€</div>
            </div>
          </Grid>
          <Grid item xs={4}>
            <div className={styles.detailsMain}>
              <div className={styles.detailsLabel}>Average revenue per order</div>
              <div className={styles.detailsValue}>{averageRevenue}€</div>
            </div>
          </Grid>
          <Grid item xs={4}>
            <div className={styles.detailsMain}>
              <div className={styles.detailsLabel}>Customers</div>
              <div className={styles.detailsValue}>{uniqueCustomersCount}</div>
            </div>
          </Grid>
        </Grid>
      </Grid>
      <Grid item>
        <h1>Revenue for month</h1>
        Graph
      </Grid>
      </StylesProvider>
    </Grid>
  );
}

export default App;
